import React, { Component } from 'react';

import {Link} from "react-router-dom";

class Nav extends Component {
  render() {
    return (
      <div className = "Nav">
        <div className = "buttonDiv"><Link className="navButton" to={{pathname: `/hobbiesList`}}>Search Canyons</Link></div>
      </div>
    );
  }
}

export default Nav;
